import React from 'react';
//resource component tell react-Admin that we want to fetch
//and display resource with the name "users"


function App() {
  async function activateLasers () {
    console.log("works");
    const response = await fetch('https://api.npms.io/v2/search?q=react');
    const data = await response.json();
    alert(data)
  } 

  return (
    <button onClick={activateLasers}>
    Activate Lasers
  </button>
   );
}

export default App;
